import React from 'react';

function ToDoLists(props){
return (
    <>
        <div className='todo_style'>
            <i className='fa fa-times' aria-hidden="true" onClick={function (){
                props.onSelection(props.id)
            }}></i>
            <li>{props.text}</li>
        </div>
    </>
)
}

export default ToDoLists;
